import React from "react"

class BookingAddServices extends React.Component {
    constructor(props) {
        super(props)
        this.state={
            loading:true
        }
    }

componentDidMount(props) {
      //Additional Services
      let addServices
      addServices = this.props.services.map(addService => {
          console.log("AddService", addService.nameService, addService.type)
         return 
         //<label className="label has-background-warning">{addService.beschreibung}
         //<input type={addService.Type} />
         //</label>)  

      });
      this.setState({loading:false})
}

render() {
    {this.state.loading ? "" : console.log("BookingAddServicesProps", this.addServices)}
    return ( 
    <div className="container is-fluid" style={{marginTop:"2em"}}>
    <div className="box">
    <h1 className="is-size-4">Weitere Dienstleistungen:  {this.state.loading ? "" : this.addServices}</h1>
    <div className="container is-fluid is-size-7 has-text-left">
        <form>

        <div className="columns">
            <div className="column">
                <div className="field">
                    <label className="label is-small">Anzahl Vegetarier:</label>
                    <div className="control">
                    <input className="input is-small is-primary" type="text" style={{width:"10%"}}></input> 
                    </div>
            </div>
            <div className="field">
                    <label className="label is-small">Anzahl Veganer:</label>
                    <div className="control">
                    <input className="input is-small is-primary" type="text" style={{width:"10%"}}></input> 
                    </div>

            </div>
            </div>
            <div className="column">
            <div className="field">
                    <label className="label is-small">Ihre Nachricht an uns:</label>
                    <div className="control">
                    <textarea class="textarea is-small is-primary" placeholder="Max. 10 Zeilen" rows="10"></textarea>
                    </div>
            </div>
            </div>
       </div>
       </form>
    </div>
    </div>
    </div>
    )
}

}

export default BookingAddServices
